      return <NavLink to={item.link}>
            <ProjectCard image={item.image} link={item.link} title={item.title}/>
         </NavLink>
    });
    return list;
  }


  render() {
    return(
    <Page className="project-page">
      {/* <Router> */}
      <div className="project-container">
      <h1> Projects</h1>
        {this.renderList(projects)}
      </div>
